function checkVariables(variables) {
  variables.forEach(variable => {
    try {
      // Using eval to check if the variable is defined
      if (typeof eval(variable) !== 'undefined') {
        console.log(`Variable "${variable}" exists with value:`, eval(variable));
      } else {
        console.log(`Variable "${variable}" is defined but undefined.`);
      }
    } catch (e) {
      console.log(`Variable "${variable}" does not exist.`);
    }
  });
}


function checkElementsLoaded(elementIds) {
  let allElementsLoaded = true;

  elementIds.forEach((elementId) => {
    const element = document.getElementById(elementId);
    if (element) {
      console.log(`Element with ID '${elementId}' is loaded`);
      element.style.display = 'none';
    } else {
      console.log(`Element with ID '${elementId}' is not found`);
      allElementsLoaded = false;
    }
  });

  return allElementsLoaded;
}

function waitForElements(elementIds) {
  const intervalId = setInterval(() => {
    if (checkElementsLoaded(elementIds)) {
      clearInterval(intervalId);
      // List of variables to check
      const variablesToCheck = ['livekitRoomAdmin', 'roomAdmin', 'isAdmin'];

      // Execute the check
      checkVariables(variablesToCheck);
    }
  }, 100); // Check every 100 milliseconds
}

// Start checking for the elements
waitForElements(['camera-btn', 'mic-btn', 'screenshare-btn']);



